import React from "react";

const List2 = (props)=>{

    return (
        <div id="List2">
            <h1> {props.heading} </h1>
            <ul>
                <li>Samsung</li>
                <li>HTC</li>   
            </ul>
            <ul><li style="type">iPhone</li></ul>
            <ul><li>Apple</li></ul>
        </div>
    );

}

export default List2 ;
